import './App.css';
import Buttons from './components/Buttons'
import SmallButtons from './components/SmallButtons';
import Switches from './components/Switches';

import { useSelector } from "react-redux";
import { BG_KEY } from "../redux/bgRedux/bgReducer";

function App() {
  let viewBg = useSelector((state) => {
    return state[BG_KEY];
  });
  return (
    <div className="App" style={{backgroundColor: viewBg.color}}>
      <Buttons/>
      <SmallButtons/>
      <Switches/>
    </div>
  );
}

export default App;
